import "./Style.css";

function ProfileCard({ name, description, instagram, instagram_url, imgProfile }) {
  return (
    <div className="profilecard">
      <div>
        <p>{name}{description}</p>
        <p>
          instaIcon{" "}
          <a target="_blank" rel="noreferrer" href={instagram_url}>
            {instagram}
          </a>
        </p>
      </div>
      <div>
        <img className="imgBook" src={imgProfile} alt="" />
      </div>
    </div>
  );
}

export default ProfileCard;
